import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import BuyerOrder from "../screens/BuyerOrder";
import BuyerDashBoard from "../screens/BuyerDashBoard";
import UserOffers from "../screens/UserOffers";
import BuyerAccount from "../screens/BuyerAccount";
import {
  Entypo,
  MaterialIcons,
  FontAwesome,
  MaterialCommunityIcons,
} from "@expo/vector-icons";
import UserComplaint from "../screens/UserComplaint";

const Tab = createBottomTabNavigator();

export default function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="BuyerDashBoard"
      screenOptions={{
        headerShown: false,
        tabBarStyle: {
          backgroundColor: "white",
        },
        tabBarShowLabel: false,
      }}
    >
      <Tab.Screen
        name="BuyerDashBoard"
        component={BuyerDashBoard}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <Entypo name="home" size={24} color="#003580" />
            ) : (
              <Entypo name="home" size={24} color="black" />
            ),
        }}
      />

      <Tab.Screen
        name="Offers"
        component={UserOffers}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialIcons name="category" size={24} color="#003580" />
            ) : (
              <MaterialIcons name="category" size={24} color="black" />
            ),
        }}
      />
      <Tab.Screen
        name="BuyerOrder"
        component={BuyerOrder}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialIcons name="assignment" size={24} color="#003580" />
            ) : (
              <MaterialIcons name="assignment" size={24} color="black" />
            ),
        }}
      />
      <Tab.Screen
        name="UserComplaint"
        component={UserComplaint}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <MaterialCommunityIcons
                name="account-question"
                size={24}
                color="#003580"
              />
            ) : (
              <MaterialCommunityIcons
                name="account-question"
                size={24}
                color="black"
              />
            ),
        }}
      />
      <Tab.Screen
        name="BuyerAccount"
        component={BuyerAccount}
        options={{
          tabBarLabel: "Home",
          headerShown: false,
          tabBarIcon: ({ focused }) =>
            focused ? (
              <FontAwesome name="user" size={24} color="#003580" />
            ) : (
              <FontAwesome name="user" size={24} color="black" />
            ),
        }}
      />
    </Tab.Navigator>
  );
}
